import { ArrowLeftOutlined, ArrowRightOutlined } from '@mui/icons-material';
import React from 'react';
import './style.css'
import styled from '@emotion/styled';

const Arrow =styled.div`
width: 50px;
    height: 50px;
    background-color: #fff7f7;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    position: absolute;
    top: 0;
    bottom: 0;
    margin: auto;
`
const Slider = () => {
    return (
        <div className="sl-container">
            <div className="sl-arrow" dir='left' >
                <ArrowLeftOutlined/>
            </div>
            <div className="sl-arrow" dir='right'>
                <ArrowRightOutlined/>
            </div>
        </div>
    );
}

export default Slider;
